in_source: |
  section .data:
  section .text:
    ei
    .loop:
        jmp .loop 

    .int1:
        lit in 
        push ; считываем символ из порта ввода
        lit 0
        cmp 
        jz .stop ; если текущий символ - нуль-терминатор, то останов
        drop
        lit out
        pop ; вывод текущего символа в порт вывода
        iret
        .stop:
            halt
